let LOCATION = msg.payload;

let ALT = LOCATION.ALT;
let LAT = LOCATION.LAT;
let LON = LOCATION.LON;

function VALUE(value, index){

    let DEGREES = Number(value.substring(0, index));
    let MINUTES = Number(value.substring(index)) / 60;

    let X = DEGREES + MINUTES;

    return X
}

let ALT_VALUE = Number(ALT);
let LAT_VALUE = VALUE(LAT, 2);
let LON_VALUE = VALUE(LON, 3);

msg.payload = {
                "ALT": ALT_VALUE,
                "LAT": LAT_VALUE,
                "LON":LON_VALUE, 
                "topic": "LAT/LON"};
return msg;

let GM;
let GPS;
let BY_ID = msg.payload.split("\n");

let X = { "port": BY_ID[1].substring(BY_ID[1].length - 7), "device": BY_ID[1].split(" ")[8] };
let Y = { "port": BY_ID[2].substring(BY_ID[2].length - 7), "device": BY_ID[2].split(" ")[8] };

if ( X["device"] == "usb-Raspberry_Pi_Pico_E6614C30939C602B-if00"){
    GM  = X["port"];
    GPS = Y["port"]; 
}
else{
    GM  = Y["port"];
    GPS = X["port"];
}

msg = [
    { "payload":{
    "serialport": "/dev/" + GM,
    "serialbaud": 9600,
    "databits": 8,
    "parity": "none",
    "stopbits": 1,
    "enabled": true
    }, "topic": "GM"},

    { "payload":{
    "serialport": "/dev/" + GPS,
    "serialbaud": 115200,
    "databits": 8,
    "parity": "none",
    "stopbits": 1,
    "enabled": true
    }, "topic": "GPS"},
]

return msg;
